import React from "react";
import "./SignInModal.css";
import { useNavigate } from "react-router-dom";
import { GoogleAuthProvider, signInWithPopup } from "firebase/auth";
import { auth } from "./Aunthenticatioin";

function SignInModal() {
  const navigate = useNavigate();

  const handleClick = async () => {
    const provider = await new GoogleAuthProvider();
    return signInWithPopup(auth, provider);
  };
  return (
    <div className="modal-parent">
      <div className="custom-modal d-flex flex-column ">
        <div className="custom-header d-flex justify-content-between align-items-center">
          <i class="fa-solid fa-lock mx-2 "></i>
          <button
            onClick={() => {
              navigate("/");
            }}
            className="btn-close my-2 mx-2"
          ></button>
        </div>
        <hr className="m-0" />
        <div className="custom-modal-body d-flex justify-content-center align-items-center">
          <div>
            <button
              onClick={() => {
                handleClick();
              }}
              className="btn-get-started"
            >
              CONTINUE
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default SignInModal;
